        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00ec9a9001eb637c8466f4"),
        "type" : "select",
        "label" : "Signtype for setup",
        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00ee749001eb637c8466fc"),
        "type" : "select",
        "label" : "Sign size",
        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00eced9001eb637c8466f5"),
        "type" : "select",
        "label" : "Route number",
        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00eeba9001eb637c8466fe"),
        "type" : "select",
        "label" : "Stand",
        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00ee849001eb637c8466fd"),
        "type" : "select",
        "label" : "Foundation",
        "value" : null,
        "dynamicTypeData" : {
            "attributes" : null,
            "options" : [ 

            ],
            "required" : false
        }
    }, 
    {
        "formElementId" : ObjectId("5d00ed0f9001eb637c8466f6"),
        "type" : "textarea",
        "label" : "Remarks regaring the new signs placement",
        "value" : null,
        "dynamicTypeData" : {
            "value" : null,
            "required" : false
        }
    }
  ]
}
</code></pre>

<p>So what I want to find is every element matches the <code>label: "Intersection number"</code> with a value that contains the char <code>x</code> in their <code>dynamicTypeData</code> object. I'm aware that I can in the console do something like: <code>db.getCollection('formRegistrations').find({formId: ObjectId("5d0889fde55fbc38509e5825")}) but how to get all the way down to the</code>dynamicTypeData` object and match with the value in that, I have no idea. Please Help :) Thanks for reading</p>

<p><strong>EDIT</strong></p>

<p>While the given answer is correct I still only wanted to <strong>find</strong> the given registrations with those parameters, because I had to manually review the data before deletion since this was done on a production ser. So from the answer given below I formulated my own script:</p>

<pre><code>db.formRegistrations.find(
    {
        formId: ObjectId("5d076f7db166bcae2743554a"),
        "formElements.0.label": "Intersection number",
        "formElements.0.dynamicTypeData.value": {
            $regex: /.*x/
        }
    }
)
</code></pre>

<p>Hope this helps someone other than myself</p>

