Return a single element from a nested lookup using an or query<p>I have the following database:</p>

<p><strong>Requests</strong> Collection</p>

<pre><code>{
    "_id" : "m5tkeDo",
    "CourseId" : "KcfEGbZlyP",
    "QuizId" : "lMJkv81LyU",
    "QuestionId" : "DF9WeKATyf",
    ...
}
</code></pre>

<p><strong>Quizzes</strong> Collection</p>

<pre><code>{
    "_id" : "lMJkv81LyU",
    ...
    "MultipleChoiceQuestions" : [],
    "MultipleSelectQuestions" : [],
    "TrueOrFalse" : [ 
        {
            "_id" : "DF9WeKATyf",
            ...
        }
    ],
    ...
}
</code></pre>

<p>Using a lookup I'm able to get the <code>Quiz</code> from the <code>Request</code>:</p>

<pre><code>db.getCollection('Requests').aggregate([
    { $match: { _id: "m5tkeDo" } },
    {
        $lookup: {
            from: "Quizzes",
            localField: "QuizId",
            foreignField: "_id",
            as: "Quiz"
         }
     },
     { $unwind: "$Quiz" }
]);
</code></pre>

<p>That returns something like this</p>

<pre><code>{
    "_id" : "m5tkeDo",
    "QuizId" : "lMJkv81LyU",
    "QuestionId" : "DF9WeKATyf",
    ...
    "Quiz" : {
        "_id" : "lMJkv81LyU",
        ...
        "MultipleChoiceQuestions" : [],
        "MultipleSelectQuestions" : [],
        "TrueOrFalse" : [ 
            {
                "_id" : "DF9WeKATyf",
                ...
            }
        ],
        ...
    }
}
</code></pre>

<p>What I'm trying to figure out is, can I get the question, which is an object in the <code>TrueOrFalse</code> array of the <code>Quiz</code>?  It is unknown whether the collection will be an item of the <code>TrueOrFalse</code>, <code>MultipleChoiceQuestions</code>, or <code>MultipleSelectQuestions</code> array so I need to look within all of them.</p>

<p>The end result is something like this:</p>

<pre><code>{
    "_id" : "m5tkeDo",
    "QuizId" : "lMJkv81LyU",
    "QuestionId" : "DF9WeKATyf",
    ...
    "Quiz" : {
        ...
    },
    "Question": {
      "_id" : "DF9WeKATyf",
       ...
    }

}
</code></pre>

