Nodejs/MongoDB: Push dynamically created object into array<p>I want to push objects into array using mongodb and nodejs.
My word schema is:</p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const wordSchema = new Schema({
  user: {
    type: Schema.Types.ObjectId,
    ref: "users"
  },
  date: {
    type: Date,
    default: Date.now
  },
  ugrWordCyr: {
    type: String,
    required: true
  },
  ugrWordArb: {
    type: String
  },
  rusTranslation: {
    type: String,
    required: true
  },
  examples: [
    {
      exCyr: { type: String },
      trRus: { type: String },
      exLat: { type: String },
      trEng: { type: String },
      exArab: { type: String }
    }
  ],
  origin: {
    type: String
  },
  sphere: {
    type: String
  },
  see: {
    type: Boolean,
    default: false
  },
  lexis: {
    type: String
  },
  grammar: {
    type: String
  },
  partOfSpeech: {
    type: String
  },
  style: {
    type: String
  }
});

module.exports = Word = mongoose.model("words", wordSchema);
</code></pre>

<p>As you can see there is the example array in the schema. It is needed to be fulled with dynamically created objects. So in my words api I am doing this thing, but it does not work.</p>

<pre><code>// @route  POST api/words
// @desc   Add words to profile
